	break;

	case 8:
	ndr_print_samr_DomInfo8(ndr, "info8", &r->info8);
	break;

	case 9:
	ndr_print_samr_DomInfo9(ndr, "info9", &r->info9);
	break;

	case 10:
	ndr_print_samr_DomInfo1(ndr, "info10", &r->info10);
